<p>不要给另外的数组分配额外的空间，你必须<a href="https://zh.wikipedia.org/wiki/%E5%8E%9F%E5%9C%B0%E7%AE%97%E6%B3%95" target="_blank" rel="noopener noreferrer"><strong>原地</strong></a>修改输入数组，使用<code>O(1)</code>的额外空间解决这一问题。</p>
